import React from 'react';
import { render } from '@testing-library/react';
import './Toolbar.css'




const toolbar = props => (

    <header>
        <nav>
            
            <div></div>
            <div><a href="/">THE LOGO</a></div>
            <div>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/About">About</a></li>
                    <li><a href="/Contact">Contact</a></li>
                    <li><a href="/NoMatch">NoMatch</a></li>
                </ul>
            </div>
        </nav>
    </header>
);

export default toolbar;
